import React, { Component } from "react";

export default class Greet extends Component {
	
	constructor(props){
		super(props);
		
		this.state = {val: "awesome"};
	}
	
	
	changeValue = () => {
		this.setState(
			{val: "wonderful"}
			);
		}
	
	render(){
		return(
			<div className="hello">
				<h1>Hello {this.state.val} World</h1>
				<button type="button" onClick={this.changeValue}>Change value</button>
			</div>
		);
	}
}
